        <meta charset="UTF-8">

    <body>
        
        <script>
            const _isSameSet = (s1, s2) => {
                // 补全代码
                if (Object.keys(s1).length !== Object.keys(s2).length) { return }
                const item = Object.keys(s1).find(key => s1[key] !== s2[key])
                if (item) { return false }
                return true
            }
        </script>
